    private static int max(int[][] arr){
            int max=0;
        for (int[] ar:arr) {
            for (int num:ar) {
                if(num>max){
                    max=num;
                }
            }
        }
        return max;
    }

    private static String replaceAll(String text,char toReplace,char newOne){
        char[] allText=text.toCharArray();
        for (int i = 0; i < allText.length; i++) {
            if(allText[i]==toReplace){
                allText[i]=newOne;
            }

        }
        return new String(allText);
    }
